 form of bubbles. None of the materials in the photo can produce bubbles, except the soap solution. Get the bubbly soap solution and spray it over the entire pipe. Check carefully for the formation of bubbles on the pipe. Mark the place where the bubbles form with a marker. This is the exact leakage location. In order to fix it, place the pipe sleeve over the leakage location. The pipe sleeve prevents gas from escaping. Now Khaled and his family are safe.</div>\\n\",\"introduction\":\"\"},\"keywords\":[{\"options\":{\"points\":1,\"occurrences\":1,\"caseSensitive\":true,\"forgiveMistakes\":false,\"feedbackIncludedWord\":\"keyword\",\"feedbackMissedWord\":\"none\"},\"keyword\":\"bubbly soap solution\"},{\"options\":{\"points\":1,\"occurrences\":1,\"caseSensitive\":true,\"forgiveMistakes\":false,\"feedbackIncludedWord\":\"keyword\",\"feedbackMissedWord\":\"none\"},\"keyword\":\"pipe sleeve\"},{\"options\":{\"points\":1,\"occurrences\":1,\"caseSensitive\":true,\"forgiveMistakes\":false,\"feedbackIncludedWord\":\"keyword\",\"feedbackMissedWord\":\"none\"},\"keyword\":\"bubbles\"}],\"overallFeedback\":[{\"from\":0,\"to\":100}],\"behaviour\":{\"inputFieldSize\":\"10\",\"enableRetry\":true,\"ignoreScoring\":false,\"pointsHost\":1,\"linebreakReplacement\":\" \"},\"checkAnswer\":\"Check\",\"tryAgain\":\"Retry\",\"showSolution\":\"Show solution\",\"feedbackHeader\":\"Feedback\",\"solutionTitle\":\"Sample solution\",\"remainingChars\":\"Remaining characters: @chars\",\"notEnoughChars\":\"You must enter at least @chars characters!\",\"messageSave\":\"saved\",\"ariaYourResult\":\"You got @score out of @total points\",\"ariaNavigatedToSolution\":\"Navigated to newly included sample solution after textarea.\",\"taskDescription\":\"<p>Describe the procedure.</p>\\n\",\"placeholderText\":\"A gas can be detected in the form of bubbles...\",\"submitAnswer\":\"Submit\",\"ariaCheck\":\"Check the answers.\",\"ariaShowSolution\":\"Show the solution. You will be provided with a sample solut
